import './CustomerPack' 

export default class Search extends Component{

   render(){


   return(

   <div>

   <h1>Search</h1>

   <p>Enter Destination</p>
       <div className="col-lg-3 mt-2 mb-2">

             <input
              className="form-control"
              type="search"
              placeholder="Search"
              name="searchTerm"
              onChange={this.handleTextSearch}
             
             ></input>


   </div>
  <a href="#">Search</a>
</div>
 
   )

   }}
